import React, { useEffect, useState } from "react";
import Axios from "axios";
import { Avatar, Button, Container, CssBaseline, IconButton, Typography, Menu, MenuItem, Grid, CircularProgress, Card, CardMedia, CardContent, CardActions, ThemeProvider } from '@mui/material';
import { styled } from '@mui/system';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import FavoriteIcon from '@mui/icons-material/Favorite';
import DeleteIcon from '@mui/icons-material/Delete';
import { useNavigate } from 'react-router-dom';

import theme from './Theme/theme';
import logo from './Theme/images/baselogo.jpg';

// Styled components using MUI's new styled API
const AppContainer = styled(Container)(({ theme }) => ({
    ...theme.root,
    zIndex: 9999,
    backgroundColor: '#f5f5f5',
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
}));

const Logo = styled('img')(({ theme }) => ({
    position: 'absolute',
    top: theme.spacing(2),
    left: theme.spacing(50),
    width: '200px',
    height: 'auto',
}));

const LogoutButton = styled(Button)(({ theme }) => ({
    position: 'absolute',
    right: 100,
    top: 20,
}));

const MoreMenuButton = styled(IconButton)(({ theme }) => ({
    position: 'absolute',
    right: 20,
    top: 20,
}));

const FavoriteCard = styled(Card)(({ theme }) => ({
    marginBottom: theme.spacing(4),
    backgroundColor: '#ffffff',
    boxShadow: '0px 3px 15px rgba(0, 0, 0, 0.1)',
    borderRadius: theme.spacing(2),
}));

const Favorites = ({ onLogout }) => {
    const [favoriteLocations, setFavoriteLocations] = useState([]);
    const [loading, setLoading] = useState(true);
    const [anchorEl, setAnchorEl] = useState(null);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        const fetchFavoriteLocations = async () => {
            try {
                const response = await Axios.get('http://localhost:8080/favorites', { withCredentials: true });
                setFavoriteLocations(response.data || []);
            } catch (error) {
                setError('Error fetching favorite locations. Please try again.');
            } finally {
                setLoading(false);
            }
        };

        fetchFavoriteLocations();
    }, []);

    const handleRemoveFavorite = async (locationId) => {
        try {
            await Axios.post('http://localhost:8080/removeFavorite', { locationId }, { withCredentials: true });
            setFavoriteLocations((prev) => prev.filter((location) => location.id !== locationId));
        } catch (error) {
            setError('Error removing favorite location. Please try again.');
        }
    };

    const handleLogOut = async () => {
        try {
            await Axios.get("http://localhost:8080/logout");
            if (onLogout) {
                onLogout();
            }
            navigate('/App');
        } catch (error) {
            setError('Log out failed: ' + error.message);
        }
    };

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleClose = () => {
        setAnchorEl(null);
    };

    const handleLogoClick = () => {
        navigate('/WalkerBoard');
    };

    if (loading) {
        return <CircularProgress />;
    }

    return (
        <ThemeProvider theme={theme}>
            <CssBaseline />
            <AppContainer>
                <Logo src={logo} alt="logo" onClick={handleLogoClick} />
                <MoreMenuButton
                    aria-label="more"
                    aria-controls="long-menu"
                    aria-haspopup="true"
                    onClick={handleClick}
                >
                    <MoreVertIcon />
                </MoreMenuButton>

                <Menu
                    id="long-menu"
                    anchorEl={anchorEl}
                    keepMounted
                    open={Boolean(anchorEl)}
                    onClose={handleClose}
                    slotProps={{
                        paper: {
                            style: {
                                maxHeight: 48 * 4.5,
                                width: '20ch',
                            },
                        },
                    }}
                >
                    <MenuItem onClick={() => { handleClose(); navigate('/Profile'); }}>
                        Profile
                    </MenuItem>
                    <MenuItem onClick={() => { handleClose(); navigate('/History'); }}>
                        History
                    </MenuItem>
                </Menu>

                <Grid container spacing={3} style={{ marginTop: '100px' }}>
                    {favoriteLocations.length > 0 ? (
                        favoriteLocations.map((location) => (
                            <Grid item xs={12} md={6} lg={4} key={location.id}>
                                <FavoriteCard>
                                    <CardMedia
                                        component="img"
                                        height="200"
                                        image={location.primaryImage}
                                        alt={location.name}
                                    />
                                    <CardContent>
                                        <Typography variant="h5" component="div" gutterBottom>
                                            <strong>{location.name}</strong>
                                        </Typography>
                                        <Typography variant="body2" color="textSecondary" component="p">
                                            {location.description}
                                        </Typography>
                                    </CardContent>
                                    <CardActions>
                                        <Button
                                            startIcon={<DeleteIcon />}
                                            color="secondary"
                                            onClick={() => handleRemoveFavorite(location.id)}
                                        >
                                            Remove from Favorites
                                        </Button>
                                    </CardActions>
                                </FavoriteCard>
                            </Grid>
                        ))
                    ) : (
                        <Typography variant="h6" color="textSecondary">
                            No favorite locations found.
                        </Typography>
                    )}
                </Grid>

                {error && <Typography variant="body1" color="error">{error}</Typography>}

                <LogoutButton variant="contained" color="secondary" onClick={handleLogOut}>
                    Logout
                </LogoutButton>
            </AppContainer>
        </ThemeProvider>
    );
};

export default Favorites;
